package com.melonlee.api.bean;import java.util.ArrayList;public class ProjectBean {	private int id;	private String title;	private String createDate;	private String baseUrl;	private String descStr;	private String version;	private ArrayList<ModuleBean> modules = new ArrayList<ModuleBean>();		public String getVersion() {		return version;	}	public void setVersion(String version) {		this.version = version;	}	public String getBaseUrl() {		return baseUrl;	}	public void setBaseUrl(String baseUrl) {		this.baseUrl = baseUrl;	}	public String getDescStr() {		return descStr;	}	public void setDescStr(String descStr) {		this.descStr = descStr;	}	public ArrayList<ModuleBean> getModules() {		return modules;	}	public void setModules(ArrayList<ModuleBean> modules) {		this.modules = modules;	}	public int getId() {		return id;	}	public void setId(int id) {		this.id = id;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public String getCreateDate() {		return createDate;	}	public void setCreateDate(String createDate) {		this.createDate = createDate;	}}